import React from "react";
import { Expenses } from "./components/Expenses";
import './components/Expenses.css'
function App() {
  const expense = [
    {
      id: 1,
      expenseDate: new Date(2021, 2, 28),
      title: 'Toilet Paper',
      amount: 10,
    },
    {
      id: 2,
      expenseDate: new Date(2021, 2, 28),
      title: 'Car Insurance',
      amount: 297.67,
    },
    {
      id: 3,
      expenseDate: new Date(2021, 2, 28),
      title: 'Home',
      amount: 10000.00,
    },
    {
      id: 4,
      expenseDate: new Date(2021, 2, 28),
      title: 'Car',
      amount: 500.00,
    },
  ]
  return (
    <div>
      <h2>Let's get started!</h2>
      <div className="expenses">
        <Expenses expense={expense}/>
      </div>
    </div>
  );
}

export default App;
